import React, { Component } from 'react';
import './App.css';
import Testdad from './components/Testdad';


class App extends Component {
  constructor (){
    super ();
    this.itemList =['tom','jerry','nhieu tien de'];
  }


  render() {
    return (
      <div className="App">
        {
          this.itemList.map((item), index => <Testdad key = {index} name = {item} />)
        }
      </div>
    );
  }
}

export default App;
